import React from 'react';
import Product from "./Product";

const ProductList = ({products}) => {
    return (
        <div>
            <h1>Product List</h1>
            {products.map((product, index) =>
                <Product product={product}/>
            )}
        </div>
    );
};

export default ProductList;
